import SvgIcon from "@material-ui/icons/Print";
import { ReactComponent as Skull } from "./skull.svg";
import { ReactComponent as Bat } from "./bat.svg";
import { ReactComponent as Pumpkin } from "./pumpkin.svg";
import { ReactComponent as Atari } from "./atari.svg";
import { ReactComponent as Maze } from "./maze.svg";
import { ReactComponent as Tama } from "./tama.svg";
import {
  Folder,
  Home,
  ColorLens,
  Pets,
  BugReport,
  WbSunny,
  SportsEsports,
  ArrowDownward,
  ArrowDropDown,
} from "@material-ui/icons";
import { GlobalThemes } from "../../ThemeManager";
import { ThemeManagerContext } from "../RenderComponent/RenderComponent";
import { useContext } from "react";
const GetIcon: any = {
  Skull: Skull,
  Bat: Bat,
  Pumpkin: Pumpkin,
  Home: Home,
  Themes: ColorLens,
  Projects: Folder,
  Bug: BugReport,
  Paw: Pets,
  Sun: WbSunny,
  Atari: Atari,
  SportsEsports: SportsEsports,
  Tama: Tama,
  ArrowDownward: ArrowDownward,
  ArrowDropDown: ArrowDropDown,
};
const Icon = ({
  icon,
  onclick,
  fontSize,
  color,
}: {
  icon?: string;
  onclick?: (e: any) => void;
  fontSize?: number;
  color?: GlobalThemes;
}) => {
  const { themeManager, theme, setThemeContext } =
    useContext(ThemeManagerContext);
  const myIcon = GetIcon[icon as string];
  if (!myIcon) return <div></div>;
  return (
    <SvgIcon
      onClick={(e: any) => {
        return onclick ? onclick(e) : null;
      }}
      style={{
        fontSize: fontSize === undefined ? 30 : fontSize,
        color: color ?? "",
      }}
      component={myIcon}
    ></SvgIcon>
  );
};
export default Icon;
